const MainWrapper = styled.section`
height: 300px;
display: flex;
align-items: center;
justify-content: center;
width: 100%;
font-weight: 600;
font-size: 40px;
text-align: center;
letter-spacing: 0.02em;
text-transform: capitalize;
`
const MainTitle = () => {
    return (
        <MainWrapper>
            <h2>
                Discover additional information about
                <br />
                a vehicle that you currently possess
                <br />
                or intend to buy:
            </h2>
        </MainWrapper>
    )
}
export default MainTitle;
